import './App.css';

function App() {
  return (
    <div className="App">
        <p>
         Bare Bones
        </p>
    </div>
  );
}

function Auth() {
  return (
    <form>
      <label for="text_form">"Enter User Name:"</label>
      <input type="text" id="text_form"></input>
      <label for="text_form">"Enter Password:"</label>
      <input type="text" id="text_form"></input>
    </form>
  )
}

export default App;
